import React from 'react'
import styled from 'styled-components'

const Signin = () => {
  return (
    <StyledForm>
      <StyledSpan>Signin</StyledSpan>
      <StyledInput placeholder='Username' type='text'></StyledInput>
      <StyledInput placeholder='password' type='password'></StyledInput>
      <StyledInput type='submit'>Signin</StyledInput>
    </StyledForm>
  )
}
const StyledSpan = styled.span`
  color: green;
  margin-bottom: 12px;
`

const StyledForm = styled.form`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`

const StyledInput = styled.input`
  margin: 6px 0px;
  border-radius: 12px;
  border: none;
  background-color: #222222;
  height: 30px;
  color: white;
  padding: 0px 6px;
`
export default Signin
